#include <sys/time.h>
#include <sys/resource.h>

double get_time()
{
    struct timeval t;
    struct timezone tzp;
    gettimeofday(&t, &tzp);
    return t.tv_sec + t.tv_usec*1e-6;
}

/* ============================================== */

Bignum *new_num(char *num) {
    Bignum *nu = malloc(sizeof(Bignum));
    for(; *num == ' ' || *num == '\t' || *num == '\n'; num++)
        ; // skip white space

    int i;
    if (*num == '-') {
        nu->sign = -1;
        num++;
    } else
        nu->sign = 1;
    for (i = 0; i < MAX_SIZE; i++)
        nu->self[i].val = 0;

    /* Get size of string */
    int len = strlen(num) - 1;

    /* Set index of last number */
    nu->start = MAX_SIZE - 1;
    /* To avoid to much memory access, simply increase i the whole time and then assign it to nu */
    i = nu->start;
    for (; len >= 0; len--) {
        nu->self[i--].val = *(num+len) - '0';
    }
    nu->start = i;
    return nu;
}

void printnum(Bignum *p) {
    int i = p->start + 1;
    if (p->sign == -1)
        printf("-");
    for (; i < MAX_SIZE; i++)
        printf("%d", p->self[i].val);
    printf("\n");
}

int smallest(int a, int b) {
    if (a < b)
        return 1;
    else if (a > b)
        return 2;
    return 0;
}

int bigger_nominal(Bignum *a, Bignum *b) {
    int s = smallest(a->start, b->start);
    if (s == 1)
        return 1;
    if (s == 2)
        return 0;
    /* If start is the same at both, check the biggest number */
    int i = a->start;
    for (; i < MAX_SIZE; i++) {
        if (a->self[i].val > b->self[i].val)
            return 1;
        if (b->self[i].val > a->self[i].val)
            return 0;
    }
    return -1;
}

Bignum *add(Bignum *a, Bignum *b) {
    int beg = MAX_SIZE - 1;

    /* Do some sign checking here!
     * This part is important: if only the second number is negative
     * we have to return the opposite action. So if we have 4 + (-5),
     * we actually subtract 5 from 4 etc.
     */
    int sign = 1;
    if (b->sign == -1) {
        if (a->sign == -1)
            sign = -1;
        else {
            b->sign = 1;
            return minus(a,b);
        }
    } else if (a->sign == -1) {
        a->sign = 1;
        return minus(b,a);
    }

    /* Choose the biggest number */
    int s = smallest(a->start, b->start);
    Bignum *biggest = new_num("0");
    int end = s == 0 || s == 1 ? a->start : b->start;
    biggest->sign = sign;

    /*
     * First, add the last digit and get the first 'rest'
     */
    int na, nb;
    na = a->self[beg].val;
    nb = b->self[beg].val;
    int t = na + nb;
    int r = t % 10;
    int rest = t / 10;
    biggest->self[beg--].val = r;

    /*
     * Loop through the digits and add them + the previous rest
     */
    for (; beg >= end; beg--) {
        t = a->self[beg].val + b->self[beg].val;
        r = t + rest;
        biggest->self[beg].val = r % 10;
        //printf("%i | %i | %i = %d | ", t, r, rest, biggest->self[beg].val);
        rest = r / 10;
    }
    biggest->start = end - 1;

    return biggest;
}

Bignum *minus(Bignum *a, Bignum *b) {
    int check = bigger_nominal(b,a);
    if (check == 1) {
        Bignum *res = minus(b,a);
        res->sign *= -1;
        return res;
    }

    /* Do some sign checking here!
     * This part is important: if only the second number is negative
     * we have to return the opposite action. So if we have 3 - (-5),
     * we actually get 4 + 5 etc.
     */
    int sign = 1;
    if (b->sign == -1) {
        /*if (a->sign == -1) {
            b->sign = 1;
            return add(a,b);
        } else {*/
            b->sign = 1;
            return add(a,b);
        //}
    } else if (a->sign == -1) {
        a->sign = 1;
        Bignum *t = add(b,a);
        t->sign = -1;
        return t;
    }

    Bignum *biggest = new_num("0");
    //biggest->sign = a->sign * b->sign;
    biggest->sign = sign;
    if (check == -1)
        return biggest;

    int beg = MAX_SIZE - 1;
    /* Choose the bigger number */
    int s = smallest(a->start, b->start);

    int end = s == 0 || s == 1 ? a->start : b->start;

    /*
     * First, subtract the last digit and get the first 'rest'
     */
    int na, nb;
    na = a->self[beg].val;
    nb = b->self[beg].val;
    int t = na - nb;
    int r = t;
    int rest = 0;
    if (t < 0) {
        r = 10 + t;
        rest = t / 10 - 1;
    }
    biggest->self[beg--].val = r;

    for (; beg >= end; beg--) {
        t = a->self[beg].val - b->self[beg].val;
        r = t < 0 ? 10 + t : t;
        r += rest;
        /* Set new rest */
        rest = t < 0 ? (t / 10) - 1 : 0;
        if (r < 0) {
            r = 10 + r;
            rest--;
        }
        /* Here we 'add' the rest (e.g. -1) */
        biggest->self[beg].val = r;
        //printf("%i - %i + %i = %d\n", a->self[beg].val, b->self[beg].val, rest, biggest->self[beg].val);

    }
    /* Because we are subtracting, we should set start
     * to the next digit that's higher than 0
     */
    while (biggest->self[beg].val == 0)
        beg++;

    /* Now start is 1 digit to far */
    biggest->start = beg - 1;

    return biggest;
}

